import React from 'react'

const FormSuccess = () => {
    return (
       <div className="form-content-right">
           <div className="form-success">
               We have received your request!
               <img src="img/success2.svg" alt="success" className="form-img-2" />
           </div>
       </div>
    )
}

export default FormSuccess;
